import {TopBar} from "./App";
import  './voice.css';
import {useEffect, useState} from "react";
import axios from 'axios';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import VideoPlayer from './video.js';
import CardContent from "@mui/material/CardContent";


const Voice = () => {
    const [imageBase64, setImageBase64] = useState('');
    const[imageBase64_2, setImageBase64_2] = useState('');

   useEffect(() => {
    axios.get('http://127.0.0.1:5000/voice')
      .then(response => {
        console.log(response.data.pitch_image);
        console.log(response.data.intensity_image);
        setImageBase64(response.data.pitch_image);
        setImageBase64_2(response.data.intensity_image);
      })
      .catch(error => console.error('Error:', error));
  }, []);

  return (
      <>
          <TopBar />
          <div>
              <Card sx={{ maxWidth: 345, marginTop: 2 }}>
                  <CardContent>
                      <Typography gutterBottom variant="h5" component="div">
                          Video Title
                      </Typography>
                      <VideoPlayer src="/Users/liyuqi/ip/static/testvideo.mp4" />
                  </CardContent>
              </Card>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel1a-content" id="panel1a-header">
                      <Typography>Summary</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          1
                      </Typography>
                  </AccordionDetails>
              </Accordion>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel2a-content" id="panel2a-header">
                      <Typography>Pitch</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          {imageBase64 && <img src={`data:image/png;base64,${imageBase64}`} alt="Generated Plot" className="responsiveImage" />}
                      </Typography>
                  </AccordionDetails>
              </Accordion>
              <Accordion>
                  <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls="panel2a-content" id="panel2a-header">
                      <Typography>Intensity</Typography>
                  </AccordionSummary>
                  <AccordionDetails>
                      <Typography>
                          {imageBase64_2 && <img src={`data:image/png;base64,${imageBase64_2}`} alt="Generated Plot" className="responsiveImage" />}
                      </Typography>
                  </AccordionDetails>
              </Accordion>
          </div>
      </>
  );
}
export default Voice;
